import React, {Component} from 'react';
import { View } from 'react-native';


export default function CategoryListItem( props ) {
    const { width, height, borderRadius, backgroundColor } = props;
    return <View style = {{
        width,
        height,
        borderRadius,
        backgroundColor
    }} />;
}
